import { Component } from "react";
import Layout1 from "../../layouts/layout1";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faChevronLeft } from "@fortawesome/free-solid-svg-icons";


class profileUser extends Component{
    render(){
        return (
            <Layout1>
                <div id="profileUser" className="container" style={{backgroundColor:'white'}}>
                    <div style={{position:'relative'}}>
                        <img style={{width:'100%',height:'201px'}} src='/images/proUser.jpg' />
                        <div className="overlay"></div>
                    </div>
                    <div className="p-20" style={{position:'relative',display:'flex'}}>
                        {/* img */}
                        <div className="profilePhoto">
                            <img style={{width:'100%'}} src='/images/imgUser.jpg'/>
                        </div>
                        {/* info */}
                        <div className="profilePhoto2 ml-20 mt-30">
                            <h1>Golden Folder</h1>
                            <span>Review Me <FontAwesomeIcon icon={faChevronLeft}/></span>
                        </div>
                    </div>

                </div>
            </Layout1>
        )
    }
}

export default profileUser
